struct Node{
       Node next;
       int val;
}

struct List{
       Node head;
}

List append(List lst, Node n) {
  // your code here
  Node t;
  if ({| (lst.head | n) ( == | != ) ( null | lst.head) |})
    {| lst.head | t | t.next |} = {| t | lst.head | n|};
  else {
    for (t = {| lst.head | n |};{| (t | t.next) (== | !=) (null | t) |} || {| (t | t.next) (== | !=) ( null | t) |};{| ( t | t.next ) |} = {| t | t.next |});
    {| t.next | t |} = {| t | t.next | n |};
  }
  return lst;
}

List insertAt(List lst, Node n, int pos) {
    // your code here

    Node h = lst.head;
    if ({| (h | h.next) (!= | ==) (null | h) |}) {
      //if head is null and position is zero then exit.
      if ({| pos (!= | ==) (0 | pos - 1) |}) {
       return lst;
      } else { //node set to the head.
       {| (h | h.next) |} = {| (n | n.next) |} ;
      }
    }

    if ({| (h | h.next) (!= | ==) (null | h) |} && {| (pos) (!= | ==) (0 | pos - 1) |}) {
      {| (n | n.next) |} = {| (h | h.next) |};
      {| (h | h.next) |} = {| (n | n.next) |};
      return lst;
    }

    Node current = {| (h | h.next) |};
    Node previous = {| (null | h | h.next) |};

    int i = ??;

    while (i < pos) {
      previous = {| (current | current.next) |};
      current = {| (current | current.next) |};

      if (current == null) {
        n.next = {| (current | current.next) |};
        previous.next = {| (n | n.next) |};
        return lst;
      }

       i++;
    }
    n.next = {| (current | current.next) |};
        previous.next = {| (n | n.next) |};
        return lst;
}



List populate(List l) {
